import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Home from './pages/Home';
import Checkout from './pages/Checkout';
import Login from './pages/Login';
import Register from './pages/Register';
import Creatives from './pages/Creatives';
import CreativeDetail from './pages/CreativeDetail';
import Services from './pages/Services';
import ServiceDetail from './pages/ServiceDetail';
import Booking from './pages/Booking';
import Messages from './pages/Messages';
import Marketplace from './pages/Marketplace';

const App: React.FC = () => {
  return (
    <Router>
        <Switch>
          <Route exact path="/" component={Home} />
          <Route exact path="/login" component={Login} />
          <Route exact path="/register" component={Register} />
          <Route exact path="/marketplace" component={Marketplace} />
          <Route exact path="/creatives" component={Creatives} />
          <Route exact path="/creatives/:id" component={CreativeDetail} />
          <Route exact path="/services" component={Services} />
          <Route exact path="/services/:id" component={ServiceDetail} />
          <Route exact path="/bookings" component={Booking} />
          <Route exact path="/messages" component={Messages} />
          <Route path="/checkout" component={Checkout} />
        </Switch>
    </Router>
  );
};

export default App;
